import React from 'react';



const Card = (props) => {

	return (

			<div className={"block rounded-lg bg-teal p-2"}>
				<div className={"flex justify-between"}>
					<div className={"block"}>
					<div>{props.cardName}</div>
					<div>{props.currency}</div>
					</div>
				</div>
				<div className={""}></div>
			</div>

		);
}

export default Card;
